CREATE TABLE `sb_shippers` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(1000) DEFAULT NULL,
  `meta_data` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `sb_shipper_config` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `shipper_id` int(11) NOT NULL,
  `meta_data` text,
  `shop_uuid` varchar(36) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `shipper_shop` (`shipper_id`,`shop_uuid`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

ALTER TABLE `sb_order` ADD `shipper_id` INT  NULL  DEFAULT NULL  AFTER `delivery_district_id`;
ALTER TABLE `sb_order` ADD `warehouse_id` INT  NULL  DEFAULT NULL  AFTER `shipper_id`;
ALTER TABLE `sb_order` ADD `shipper_receive_time` DATETIME  NULL  AFTER `shipper_id`;
ALTER TABLE `sb_order` ADD `shipper_deliver_time` DATETIME  NULL  AFTER `shipper_receive_time`;
ALTER TABLE `sb_order` ADD `shipping_code` VARCHAR(100)  NULL  DEFAULT NULL  AFTER `shipper_deliver_time`;
ALTER TABLE `sb_order` ADD `delivery_status` ENUM('received','successful','fail')  NULL  DEFAULT NULL  AFTER `delivery_note`;
ALTER TABLE `sb_order` ADD `delivery_metadata` TEXT  NULL  AFTER `delivery_status`;

CREATE TABLE `sb_warehouse` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(500) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `address` varchar(500) DEFAULT NULL,
  `province_id` int(11) DEFAULT NULL,
  `district_id` int(11) DEFAULT NULL,
  `is_default` tinyint(4) NOT NULL DEFAULT '0',
  `shop_uuid` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `sb_warehouse_delivery` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `warehouse_id` int(11) DEFAULT NULL,
  `province_id` int(11) DEFAULT NULL,
  `shop_uuid` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

ALTER TABLE `sb_product` ADD `weight` FLOAT  NOT NULL  DEFAULT '0'  AFTER `content`;
ALTER TABLE `sb_order` ADD `prepaid_amount` DECIMAL(15,2)  NULL  DEFAULT '0.00'  AFTER `amount`;

